import NavBar from './Navbar.js';

export const About = () => {
  return (
    <div>
      <NavBar />
      <div className="container">
        
        <div class="contenedor-imagen">
      
        </div>
        <div className="container">
          
          <h3>Nosotros</h3>


        </div>

      </div>
    </div>
  );
}

export default About;
